import s from './FeedbackBtn.module.css';

const FeedbackBtn = ({setVote}) => {
    return (
        <div>
            <h1 className={s.header}>Please leave feedback</h1>
            <button className={s.btn} onClick={() => setVote("good")} type="button">Good :)</button>
            <button className={s.btn} onClick={() => setVote("neutral")} type="button">Neutral :/</button>
            <button className={s.btn} onClick={() => setVote("bad")} type="button">Bad :(</button>
        </div>
    )
}

export default FeedbackBtn;
